import React from 'react';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav'; // If you want navigation links later

function App() {
  return (
    <div className="App">
      <Navbar bg="dark" variant="dark">
        <Container>
          <Navbar.Brand href="#home">SimAcc Portal</Navbar.Brand>
          {/* You can add Nav links here later */}
          <Nav className="me-auto">
            {/* <Nav.Link href="#login">Login</Nav.Link> */}
          </Nav>
        </Container>
      </Navbar>
      <Container className="mt-4"> {/* mt-4 adds margin top */}
        {/* This is where the content of your current page will go */}
        <h2>Welcome to the SimAcc Portal</h2>
        {/* You'll replace this with components for different pages */}
      </Container>
      {/* You can add a footer component here later */}
    </div>
  );
}

export default App;
